import React from "react";

const NoteItems = (props) => {
  const { note } = props;
  return (
    <div>
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">{note.title}</h5><i class="material-icons">delete</i>
          <p class="card-text">{note.description}</p>
        </div>
      </div>
    </div>
  );
};

export default NoteItems;
